import React from "react";
import "../styles/main.css";
import heroImg from "../assets/fam.png";

const Main = () => (
  <section className="intro">
    <div className="content">
      <p className="intropara">
        From <span className="highlight-pink">admissions to accommodation</span> - we've got you.
      </p>
      <h1>
        Helping you <span className="highlight-pink">find a comfot zome</span>.<br />
        Right <span className="highlight-pink">near</span> campus.
      </h1>
      <button className="btn">
        Check what's best for <span className="arrow">&#8595;</span>
      </button>
    </div>
    <div className="famimg">
      <img src={heroImg} alt="Family" />
    </div>
  </section>
);

export default Main;
